import Layout from "../components/Layout"
import Head from 'next/head'
import logoTitleImage from '../images/logo_title.png'
import mainImage from '../images/contact_main.jpg'

const Contact = () => {
    return (
        <div>
            <Head>
                <title>La Garchere - Contact</title>
                <link rel="icon" href={logoTitleImage} type="image/icon type"/>
            </Head>
        <Layout>
            <div className="contact-container">
                <div className="container-main">
                    <img className="bg-image" src={mainImage} alt="La Garchère"/>
                    <div className="main-block">
                        <form>
                            <input type="text" placeholder="Voornaam"/>
                            <input type="text" placeholder="Achternaam"/>
                            <input type="email" placeholder="Email"/>
                            <input type="password" placeholder="Wachtwoord"/>
                            <textarea>Bericht</textarea>
                            <button className="button-style-one">Verzenden</button>
                        </form>
                    </div>
                </div>
            </div>
        </Layout>
    <style jsx>{`
        .container-main {
            height: 100vh;
            margin: 0 auto;
            overflow: hidden;
            position: relative;
            top: -65px;
        }
        .bg-image {
            height: 100%;
            left: 50%;
            margin-left: -600px;
            position: absolute;
        }
        .main-block {
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            padding: 20px;
            text-align: center;
            position:absolute;
            top: 25%;
            max-width: 400px;
        }

        @media (min-width: 50em) {        
            .bg-image {
              margin-left: 0;
              left: 0;
            }
        }

        @media (min-width: 60em) {
            .main-block { 
              margin-left: 10%;
            }

            .container-main {
              top: -110px;
            }

            .bg-image {
              width: 100%;
              height: auto;
            }

            .main-block img {
              width: 400px;
            }
        }

    `}</style>
        </div>
    )
  }

  export default Contact
